import axios from "axios";

import { makeStyles } from '@material-ui/core/styles';
import Table from '@material-ui/core/Table';
import TableBody from '@material-ui/core/TableBody';
import TableCell from '@material-ui/core/TableCell';
import TableContainer from '@material-ui/core/TableContainer';
import TableHead from '@material-ui/core/TableHead';
import TableRow from '@material-ui/core/TableRow';
import Paper from '@material-ui/core/Paper';
import react, { useEffect, useState } from "react";
import { Button, ButtonBase, FormLabel, TextField } from "@material-ui/core";
import { Link } from "react-router-dom/cjs/react-router-dom.min";
import { toast, ToastContainer } from "react-toastify";
import 'react-toastify/dist/ReactToastify.css';

export default function UserList() {
  const [users, setUsers] = useState([]);
  const [search,setSearch]=useState("")
  useEffect(() => {
   loadProduct()
  }, []);

  const loadProduct=async()=>{
    await axios.get("http://localhost:3003/shop").then((res) => {

        setUsers(res.data);
      });

    }
  const useStyles = makeStyles({

      action: {
        display:"flex",
        marginLeft:"25px",
        textAlign:"center"


            },


    tablecell:{
        textAlign:"left"
    },
    tablerow:{
        textAlign:"inherit"
    },
    btn:{
      backgroundColor:"rgb(228, 228, 250)",
      float:"center",
      margincenter:50
    }
  });
  const classes = useStyles();
const DeleteProduct=async(id)=>{
await axios.delete(`http://localhost:3003/shop/${id}`)
loadProduct()
toast("deleted")
}
  return (
    <div className="UserList">
    <div className="App">
  <Link to="/add"> <Button variant="outlined" >
        Add Shop
      </Button></Link> 
     <input onChange={(e)=>setSearch(e.target.value)} type="search" placeholder="serach.." className="search"/>
    <br/>
    <br/>
    <br/>
      <div className="flex">
        <form>
          <TableContainer component={Paper}>
      <Table className={classes.table} aria-label="simple table">  
        <TableHead>
          <TableRow className={classes.tablerow} >
            <TableCell>Sl NO</TableCell>
            <TableCell align="center">Name</TableCell>
            <TableCell align="center">Location</TableCell>
            <TableCell align="center">Action</TableCell>



          </TableRow>
        </TableHead>
        <TableBody>
              {users && users.filter((val)=>{
                if (search==""){
                  return val
                }
                else if (val.name.toLowerCase().includes(search.toLowerCase())){
                  return val
                }




              }).map((datas, i) => {
                  return (
                  <TableRow key={i}>
                     <TableCell  component="th" scope="row">{i + 1}</TableCell>
              <TableCell align="center">{datas.name}</TableCell>
              <TableCell align="center">{datas.location}</TableCell>
              <TableCell className={classes.action}> <Button>   <Link  to={`/shop/${datas.id}`}>view</Link></Button>

             <Button onClick={()=>DeleteProduct(datas.id)}>Delete </Button>
                 <ToastContainer/>
                 <Button>  <Link

                        to={`/shop/edit/${datas.id}`}
                      >
                        Edit
                      </Link></Button></TableCell>
              </TableRow>
                  );
                })}
            </TableBody>
      </Table>
    </TableContainer>
        </form>
      </div>  
    </div>
    </div>
  );
}
